INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (4852, 21657, 'Aluminum hydroxide', 'The concomitant administration of aluminum-containing products (e.g., antacids and phosphate binders) and citrates may significantly increase serum aluminum concentrations, resulting in toxicity.  Citrates or citric acid are contained in numerous soft drinks, citrus fruits, juices, and effervescent and dispersible drug formulations.  Citrates enhance the gastrointestinal absorption of aluminum by an unknown mechanism, which may involve the formation of a soluble aluminum-citrate complex.', 'citrus fruits', 'Major', '', 'DDInter', 0, X'', NULL, X'');
