INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (4855, 28230, 'Dolutegravir', 'Food increases the extent of absorption and slows the rate of absorption of dolutegravir.  When administered with a low-, moderate- or high-fat meal, dolutegravir peak plasma concentration (Cmax) increased by 46%, 52% and 67%, systemic exposure (AUC) increased by 33%, 41% and 66%, and time to reach Cmax (Tmax) increased from 2 hours to 3, 4 and 5 hours, respectively, compared to administration under fasted conditions.', 'food', 'Minor', '', 'DDInter', 0, X'789c73c9cf292d494d2f4a2ccb2c52c84dac54484a552849cc4ecd5328cf2cc950c82f02d3f9a5250a69f9f9297a00a9e81181', NULL, X'');
