INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (4891, 17912, 'Dronedarone', 'Grapefruit juice may increase the plasma concentrations of dronedarone.  The proposed mechanism is inhibition of CYP450 3A4-mediated first-pass metabolism in the gut wall by certain compounds present in grapefruits.  According to the product labeling, administration with grapefruit juice resulted in a 2.5-fold increase in dronedarone peak plasma concentration and a 3-fold increase in systemic exposure.  Because dronedarone is associated with concentration-dependent prolongation of the QT interval, increased levels may potentiate the risk of ventricular arrhythmias such as torsade de pointes and sudden death.', 'grapefruit juice', 'Major', '', 'DDInter', 0, X'789c658ed11183300c4357d1001c537480aee012032e899d4b1c28db17e80f77fdd1e943d2d3935c58bdc20b9373c0263e2314530e742aea6c2d06d06a123098d696b28b296cc45428f3589a7877f3783719b803e951d31db5e51c391d98b3ef242a3addf3fcf14283f7c0e31ffc62382dacf0ed58452089fbefa5cf8c64e55a3b59bcf2e51353acfd17688351e2', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (4892, 29021, 'Dronedarone', 'Grapefruit juice may increase the plasma concentrations of dronedarone.  The proposed mechanism is inhibition of CYP450 3A4-mediated first-pass metabolism in the gut wall by certain compounds present in grapefruits.  According to the product labeling, administration with grapefruit juice resulted in a 2.5-fold increase in dronedarone peak plasma concentration and a 3-fold increase in systemic exposure.  Because dronedarone is associated with concentration-dependent prolongation of the QT interval, increased levels may potentiate the risk of ventricular arrhythmias such as torsade de pointes and sudden death.', 'grapefruit juice', 'Major', '', 'DDInter', 0, X'789c658ed11183300c4357d1001c537480aee012032e899d4b1c28db17e80f77fdd1e943d2d3935c58bdc20b9373c0263e2314530e742aea6c2d06d06a123098d696b28b296cc45428f3589a7877f3783719b803e951d31db5e51c391d98b3ef242a3addf3fcf14283f7c0e31ffc62382dacf0ed58452089fbefa5cf8c64e55a3b59bcf2e51353acfd17688351e2', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (4893, 29022, 'Dronedarone', 'Grapefruit juice may increase the plasma concentrations of dronedarone.  The proposed mechanism is inhibition of CYP450 3A4-mediated first-pass metabolism in the gut wall by certain compounds present in grapefruits.  According to the product labeling, administration with grapefruit juice resulted in a 2.5-fold increase in dronedarone peak plasma concentration and a 3-fold increase in systemic exposure.  Because dronedarone is associated with concentration-dependent prolongation of the QT interval, increased levels may potentiate the risk of ventricular arrhythmias such as torsade de pointes and sudden death.', 'grapefruit juice', 'Major', '', 'DDInter', 0, X'789c658ed11183300c4357d1001c537480aee012032e899d4b1c28db17e80f77fdd1e943d2d3935c58bdc20b9373c0263e2314530e742aea6c2d06d06a123098d696b28b296cc45428f3589a7877f3783719b803e951d31db5e51c391d98b3ef242a3addf3fcf14283f7c0e31ffc62382dacf0ed58452089fbefa5cf8c64e55a3b59bcf2e51353acfd17688351e2', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (4894, 208, 'Doxylamine', 'Alcohol may potentiate some of the pharmacologic effects of CNS-active agents.  Use in combination may result in additive central nervous system depression and/or impairment of judgment, thinking, and psychomotor skills.', 'alcohol', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (4896, 31974, 'Drospirenone', 'Grapefruit juice may increase the plasma concentrations of orally administered drugs that are substrates of the CYP450 3A4 isoenzyme.  The proposed mechanism is inhibition of CYP450 3A4-mediated first-pass metabolism in the gut wall by certain compounds present in grapefruit.  Because grapefruit juice inhibits primarily intestinal rather than hepatic CYP450 3A4, the magnitude of interaction is greatest for those drugs that undergo significant presystemic metabolism by CYP450 3A4 (i.e., drugs with low oral bioavailability).  In general, the effect of grapefruit juice is concentration-, dose- and preparation-dependent, and can vary widely among brands.  Certain preparations of grapefruit juice (e.g., high dose, double strength) have sometimes demonstrated potent inhibition of CYP450 3A4, while other preparations (e.g., low dose, single strength) have typically demonstrated moderate inhibition.', 'grapefruit juice', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (4898, 3229, 'Duloxetine', 'Use of duloxetine in conjunction with chronic alcohol consumption may potentiate the risk of liver injury.', 'alcohol', 'Moderate', '', 'DDInter', 0, X'789c65ced10dc2300c84e1556e00c4145d244d0e62b0e22a764abb3ded030889e793beffa64184212ad1c59fb01b545676487b8cbe5fb0a410b6702c9d9ebbcc2c28436d634823bcdad08299c8369a538ff9f0d26a52c02dd3fde0309c279d345b35bd02d31f7167634faa3b9ac509fe040ff1fbe32551e163f6482d24e9073d1bd73738a54d37', NULL, X'789c1dccd10d80200c05c055de046ee300a4d650c4964051d95ef1ff726b63d88ead677bd84519a220d3d4955c4c718b4750aca64208992c5a9ea0f5b3fce00c03c59cd52538c323a34a3be69ae5e2fa85a9d7b1bc6850282c');
