INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (4921, 28586, 'Dulaglutide', 'Alcohol may cause hypoglycemia or hyperglycemia in patients with diabetes.  Hypoglycemia most frequently occurs during acute consumption of alcohol.  Even modest amounts can lower blood sugar significantly, especially when the alcohol is ingested on an empty stomach or following exercise.  The mechanism involves inhibition of both gluconeogenesis as well as the counter-regulatory response to hypoglycemia.  Episodes of hypoglycemia may last for 8 to 12 hours after ethanol ingestion.  By contrast, chronic alcohol abuse can cause impaired glucose tolerance and hyperglycemia.  Moderate alcohol consumption generally does not affect blood glucose levels in patients with well controlled diabetes.  A disulfiram-like reaction (e.g., flushing, headache, and nausea) to alcohol has been reported frequently with the use of chlorpropamide and very rarely with other sulfonylureas.', 'alcohol', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (4922, 28587, 'Dulaglutide', 'Alcohol may cause hypoglycemia or hyperglycemia in patients with diabetes.  Hypoglycemia most frequently occurs during acute consumption of alcohol.  Even modest amounts can lower blood sugar significantly, especially when the alcohol is ingested on an empty stomach or following exercise.  The mechanism involves inhibition of both gluconeogenesis as well as the counter-regulatory response to hypoglycemia.  Episodes of hypoglycemia may last for 8 to 12 hours after ethanol ingestion.  By contrast, chronic alcohol abuse can cause impaired glucose tolerance and hyperglycemia.  Moderate alcohol consumption generally does not affect blood glucose levels in patients with well controlled diabetes.  A disulfiram-like reaction (e.g., flushing, headache, and nausea) to alcohol has been reported frequently with the use of chlorpropamide and very rarely with other sulfonylureas.', 'alcohol', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (4924, 14247, 'Efavirenz', 'Administration with food increases the plasma concentrations of efavirenz and may increase the frequency of adverse reactions.  According to the product labeling, administration of efavirenz capsules (600 mg single dose) with a high-fat/high-caloric meal (894 kcal, 54 g fat, 54% calories from fat) or a reduced-fat/normal-caloric meal (440 kcal, 2 g fat, 4% calories from fat) was associated with mean increases of 39% and 51% in efavirenz peak plasma concentration (Cmax) and 22% and 17% in systemic exposure (AUC), respectively, compared to administration under fasted conditions.  For efavirenz tablets, administration of a single 600 mg dose with a high-fat/high-caloric meal (approximately 1000 kcal, 500-600 kcal from fat) resulted in a 79% increase in mean Cmax and a 28% increase in mean AUC of efavirenz relative to administration under fasted conditions.', 'high-fat foods', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (4926, 25974, 'Eltrombopag', 'Food may reduce the oral bioavailability of eltrombopag.  In healthy volunteers, a standard high-fat breakfast significantly decreased plasma eltrombopag peak plasma concentration (Cmax) by 65% and systemic exposure (AUC) by 59% and delayed Tmax by one hour.', 'high-fat foods', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (4927, 25975, 'Eltrombopag', 'Food may reduce the oral bioavailability of eltrombopag.  In healthy volunteers, a standard high-fat breakfast significantly decreased plasma eltrombopag peak plasma concentration (Cmax) by 65% and systemic exposure (AUC) by 59% and delayed Tmax by one hour.', 'high-fat foods', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (4928, 29183, 'Eltrombopag', 'Food may reduce the oral bioavailability of eltrombopag.  In healthy volunteers, a standard high-fat breakfast significantly decreased plasma eltrombopag peak plasma concentration (Cmax) by 65% and systemic exposure (AUC) by 59% and delayed Tmax by one hour.', 'high-fat foods', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (4929, 25974, 'Eltrombopag', 'Food may reduce the oral bioavailability of eltrombopag. The calcium content of this meal may have also contributed to this decrease in exposure.  In another study, adult subjects administered a single 25 mg dose of eltrombopag for oral suspension with a high-calcium, moderate-fat, moderate-calorie meal exhibited a 79% decrease in Cmax and 75% decrease in AUC of eltrombopag.  Administration of eltrombopag 2 hours after the high-calcium meal decreased eltrombopag Cmax by 48% and AUC by 47%, while administration 2 hours before the high-calcium meal decreased eltrombopag Cmax by 14% and AUC by 20%.', 'dairy products', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (4930, 25975, 'Eltrombopag', 'Food may reduce the oral bioavailability of eltrombopag. The calcium content of this meal may have also contributed to this decrease in exposure.  In another study, adult subjects administered a single 25 mg dose of eltrombopag for oral suspension with a high-calcium, moderate-fat, moderate-calorie meal exhibited a 79% decrease in Cmax and 75% decrease in AUC of eltrombopag.  Administration of eltrombopag 2 hours after the high-calcium meal decreased eltrombopag Cmax by 48% and AUC by 47%, while administration 2 hours before the high-calcium meal decreased eltrombopag Cmax by 14% and AUC by 20%.', 'dairy products', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
