INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (4985, 2834, 'Entecavir', 'Food delays the oral absorption and reduces the oral bioavailability of entecavir.  According to the product labeling, administration of entecavir 0.5 mg with a standard high-fat meal or a light meal resulted in a delay in absorption by 0.25 to 0.75 hours, a decrease in the peak plasma concentration (Cmax) by 44% to 46%, and a decrease in the area under the plasma concentration-time curve (AUC) by 18% to 20% compared to administration in the fasting state.', 'high-fat foods', 'Moderate', '', 'DDInter', 0, X'789c3d8dc10dc3300c0357e100451f9da50bc831031bb0a4c0528a74fbba7df4c3cf1dc9a78316e72454aeae32e0738594f0796477bb2d9edce4d527a2f9392a0a2155bbf5484e56b8410cd423df887495ad411283128907566906645f3204caefbcd53f28dc7ddd67238c57fe84fb0788b336ad', NULL, X'');
